import React from 'react';
import './App.css';
import PersonalInfo from './PersonalInfo';
import Projects from './Projects.js';
import Courses from './Courses.js';
import logo from './logojl.png';
function App() {
  return (
    <div className="App">
      {/* <canvas id="canvas"></canvas> */}
      <div className="Header">
        <img src={logo} className="Logo" alt="logo" />
      </div>
      <div className='top-section'>
        <canvas id="canvas"></canvas>
        <h1 className="Title">Hi,</h1>
        <h1 className="Title">I'm Jerry,</h1>
        <h1 className="sub-Title">Third Year @UChicago</h1>
        <p className="Intro">Welcome to my homepage. I am  majoring in Computer Science, Math, and Statistics. I've explored from data analysis, AI, to trading and software engineering. My goal is to become a smart <b>tech</b> person and contribute to the tech community, by being kind, thoughtful, and strong.</p>
      </div>

      <div id="personalinfo" className='section'>
        <PersonalInfo />
      </div>

      <div id="projects" className='section'>
        <Projects />
      </div>

      <div id="courses" className='section'>
        <Courses />
      </div>
    </div>
  );
}

export default App;
